	PackFile()
	{
		numfiles = levelNames.size();
		levelDataLength = 0;
		currentId = 0;
	}

	~PackFile() {	}

	void ResetId() { currentId = 0; }

	int SetLevel(std::string name)
	{
		int itr_id = 0;
		for (const auto& itr_name : levelNames)
		{
			if (itr_name == (std::string)name) {
				currentId = itr_id;
				return itr_id;
			}
			itr_id++;
		}
		return -1;
	}
	std::vector<char> GetLevelDataVec() {
		return levelDataBytes[currentId];
	}
	unsigned int GetLevelDataLength() {
		return levelDataBytes[currentId].size();
	}

